import './App.css';
import {useState} from "react";

function App() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        fetch("http://localhost:8080/api/users")
            .then(response => response.json())
            .then(data => {
                setUsers(data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);
  return (
    <div className="App">
      <table>
          <tr>
              <th>Mail</th>
              <th>Password</th>
              <th>Name</th>
              <th>Surname</th>
              <th>Gender</th>
              <th>Reg. Customer</th>
              <th></th>
              <th></th>
          </tr>
      </table>
    </div>
  );
}

export default App;
